import { BrowserRouter,Router, Routes } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <div className="App">
      {/*Navbar*/}
      {/*SideDrawer*/}
      {/*Backdrop*/}
      <main>
        <Router>
          <Routes exact path = '/' component = {HomeScreen}/>
          <Routes exact path = '/product/:id' component = {ProductScreen}/>
          <Routes exact path = '/cart' component = {CartScreen}/>
        </Router>
      </main>
      {/*HomeScreen*/}
      {/*ProductScreen*/}
      {/*ServicesScreen*/}
      {/*CartScreen*/}
    </div>
  );
}

export default App;
